function loadJSON(path, success, error) {
	var xhr = new XMLHttpRequest();
	xhr.onreadystatechange = function () {
	  if (xhr.readyState === 4) {
		if (xhr.status === 200) {
		  success(JSON.parse(xhr.responseText));
		}
		else {
		  error(xhr);
		}
	  }
	};
	xhr.open('GET', path, true);
	xhr.send();
  }

function App() {
  loadJSON('http://api.openweathermap.org/data/2.5/weather?q=London&appid=52b987646ad8d9b43f889187f3d68809&units=metric');

}

export default App;
